import logo from './logo.svg';
import './App.css';
import Navbar from './Navbar';
import Sidebar from './Sidebar';

function App() {
  return (
    <div className="App">

      <Navbar />
      <section className="what-we-do">
        <h1>What do we do?</h1>
        <div className="content-blocks">
          <div className="content-block">
            <h2>SEED</h2>
            <p>Description of SEED program...</p>
          </div>
          <div className="content-block">
            <h2>UKC</h2>
            <p>Description of UKC initiative...</p>
          </div>
          <div className="content-block">
            <h2>Katalyst</h2>
            <p>Description of Katalyst activities...</p>
          </div>
          <div className="content-block">
            <h2>STEP-UP</h2>
            <p>Description of STEP-UP opportunities...</p>
          </div>
        </div>
      </section>


    </div>
  );
}

export default App;
